    function positionState(bytes32 currencyKey, uint32 positionId) external  view returns (address account,uint256 pSize,
    uint256 pValue,uint256 forceLiquidation,uint256 PnL) {
        ISystemSetting setting = systemSetting();

        Position memory p = _positions[positionId];

        pSize=p.leveragedPosition.mul(1e18).mul(1e12) / p.openPositionPrice ;
        //pSize=p.leveragedPosition;
        (uint32 currencyKeyIdx, uint newPrice) = exchangeRates().rateForCurrency(currencyKey);
        pValue = pSize*newPrice/1e18;  
        if (p.direction==1){
            forceLiquidation =  (p.openPositionPrice) -(p.margin*(1*1e18-setting.marginRatio())/pSize*1e12);
        }else{
            forceLiquidation =  (p.openPositionPrice) +(p.margin*(1*1e18-setting.marginRatio())/pSize*1e12);
        }

        //forceLiquidation= newPrice;
        //require(false,"false");
        PnL = p.openPositionPrice.diff(newPrice)/1e18*pSize;


        return (p.account, pSize,pValue,forceLiquidation,PnL);
    }


